import React, { useState } from 'react';
import { motion } from 'framer-motion';

interface PrintItem {
  id: string;
  title: string;
  price: number;
  mainImage: string;
  images: string[];
  video?: string;
  description: string;
  specifications: string[];
}

const printItems: PrintItem[] = [
  {
    id: 'print1',
    title: 'Robot 360Â°',
    price: 49.99,
    mainImage: '/images/robot-main.jpg',
    images: ['/images/robot-1.jpg', '/images/robot-2.jpg', '/images/robot-3.jpg'],
    video: '/videos/robot-360.mp4',
    description: 'A stunning 360-degree view of a detailed robot model, perfect for showcasing mechanical details and design elements.',
    specifications: [
      'High-quality PLA material',
      'Smooth surface finish',
      '360-degree rotating base included',
      'Comes with display stand'
    ]
  },
  {
    id: 'print2',
    title: 'Flower Vase',
    price: 39.99,
    mainImage: '/images/flower1.png',
    images: ['/images/flower1.png', '/images/flower1.png', '/images/flower1.png'],
    description: 'Elegant flower vase with intricate geometric patterns, perfect for home decoration.',
    specifications: [
      'Premium PLA material',
      'Water-resistant coating',
      'Multiple size options available',
      'Custom color options'
    ]
  },
  {
    id: 'print3',
    title: 'Warrior Statue',
    price: 59.99,
    mainImage: '/images/warrior.png',
    images: ['/images/warrior.png', '/images/warrior.png', '/images/warrior.png'],
    description: 'Detailed warrior statue with dynamic pose and intricate armor details.',
    specifications: [
      'High-strength PLA material',
      'Detailed surface texture',
      'Stable base design',
      'Optional LED base available'
    ]
  }
];

const ThreeDPrints: React.FC = () => {
  const [selectedPrint, setSelectedPrint] = useState<PrintItem | null>(null);
  const [activeImage, setActiveImage] = useState<string>('');

  const handlePrintClick = (print: PrintItem) => {
    setSelectedPrint(print);
    setActiveImage(print.mainImage);
  };

  const handleCloseModal = () => {
    setSelectedPrint(null);
    setActiveImage('');
  };

  const handleThumbnailClick = (image: string) => {
    setActiveImage(image);
  };

  return (
    <div className="prints-section">
      <div className="prints-container">
        <motion.div
          className="prints-header"
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5 }}
        >
          <h2>3D Prints Collection</h2>
          <p>Browse our curated collection of unique 3D printed toys and figures, ready to be made just for you!</p>
        </motion.div>

        <div className="prints-grid">
          {printItems.map((print) => (
            <motion.div
              key={print.id}
              className="print-item-card"
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5 }}
              whileHover={{ scale: 1.02 }}
              onClick={() => handlePrintClick(print)}
            >
              <div className="print-item-image">
                <img src={print.mainImage} alt={print.title} />
              </div>
              <div className="print-item-info">
                <h4 className="print-item-title">{print.title}</h4>
                <p className="print-item-price">${print.price.toFixed(2)}</p>
              </div>
            </motion.div>
          ))}
        </div>

        {/* Modal */}
        {selectedPrint && (
          <div className="print-modal-overlay" onClick={handleCloseModal}>
            <div className="print-modal-content" onClick={e => e.stopPropagation()}>
              <button className="print-modal-close" onClick={handleCloseModal}>&times;</button>
              
              {/* Left Column - Media Gallery */}
              <div className="print-modal-gallery">
                <div className="print-modal-main-image">
                  {activeImage === selectedPrint.video ? (
                    <div className="video-container">
                      <video
                        src={selectedPrint.video}
                        controls
                        style={{ width: '100%', height: '100%', objectFit: 'cover' }}
                      />
                    </div>
                  ) : (
                    <img src={activeImage} alt={selectedPrint.title} />
                  )}
                </div>
                <div className="print-modal-thumbnails">
                  <div
                    className={`print-modal-thumbnail ${selectedPrint.mainImage === activeImage ? 'active' : ''}`}
                    onClick={() => handleThumbnailClick(selectedPrint.mainImage)}
                  >
                    <img src={selectedPrint.mainImage} alt="Main view" />
                  </div>
                  {selectedPrint.images.map((image, index) => (
                    <div
                      key={index}
                      className={`print-modal-thumbnail ${image === activeImage ? 'active' : ''}`}
                      onClick={() => handleThumbnailClick(image)}
                    >
                      <img src={image} alt={`View ${index + 1}`} />
                    </div>
                  ))}
                  {selectedPrint.video && (
                    <div
                      className={`print-modal-thumbnail video ${selectedPrint.video === activeImage ? 'active' : ''}`}
                      onClick={() => handleThumbnailClick(selectedPrint.video!)}
                    >
                      <img src={selectedPrint.mainImage} alt="Video thumbnail" />
                      <div className="video-indicator">â¶</div>
                    </div>
                  )}
                </div>
              </div>
              
              {/* Right Column - Product Info */}
              <div className="print-modal-info">
                <h2 className="print-modal-title">{selectedPrint.title}</h2>
                <p className="print-modal-description">{selectedPrint.description}</p>
                
                <div className="print-modal-details">
                  <h4>Specifications</h4>
                  <ul className="print-details-list">
                    {selectedPrint.specifications.map((spec, index) => (
                      <li key={index}>{spec}</li>
                    ))}
                  </ul>
                </div>
                
                <div className="print-modal-price">${selectedPrint.price.toFixed(2)}</div>
                
                <a href="/contact" className="print-modal-cta">
                  Order This Print
                </a>
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default ThreeDPrints;
